import React from 'react';
import CommonBody from './CommonBody';


const About = () => {

    return (
        <>
            <CommonBody 
                h1Dsc='Bit about us' 
                h2Dsc='One stop for all of your web development needs.' 
                btnDsc='Contact Now'
                img={BodyImg}
                />
        </>
    );
};

export default About;
